import {NavLink} from 'react-router-dom';

export default function Navbar() {
    return <div className="nav">
    <NavLink
    to="/faq"
    className={isActive =>
        "nav-link" + (!isActive ? " unselected" : "")
    }
    >
    FAQs
    </NavLink>
    </div>
}
